css:
atom-text-editor:not(.mini)::shadow .lines .line .trailing-whitespace {
  background: #ff4800;
  border-radius: 2px;
}
atom-text-editor:not(.mini)::shadow .lines .line .trailing-whitespace.indent-guide {
  background: none;
}
atom-text-editor:not(.mini)::shadow .lines .line.cursor-line .trailing-whitespace {
  background: none;
  transition: all 0.4s;
  transition-delay: 0.1s;
}
.trailing-spaces-highlight-cursor-lines atom-text-editor:not(.mini)::shadow .lines .line.cursor-line .trailing-whitespace:not(.indent-guide) {
  background: #ff4800;
}
.trailing-spaces-highlight-indentation atom-text-editor:not(.mini)::shadow .lines .line:not(.cursor-line) .trailing-whitespace.indent-guide {
  background: #ff4800;
}
.trailing-spaces-highlight-cursor-lines.trailing-spaces-highlight-indentation atom-text-editor:not(.mini)::shadow .lines .line.cursor-line .trailing-whitespace.indent-guide {
  background: #ff4800;
}
